import * as React from 'react';
import Box from '@mui/material/Box';
export default function BoxSystemProps({ job }) {
  return (
    <Box
      height={200}
      width={300}
      my={4}
      display="flex"
      justifyContent="center"
      alignItems="center"
      gap={4}
      p={2}
      sx={{ border: '2px solid grey' }}
    >
    <div>
        {job.title}
    </div>
        
    {job.skills}
    {job.description}
    </Box>
  );
}
